import React, { Component } from 'react';

class Header extends Component {

  render() {
    return (
        <div className="App">

      <header>
          <div class="sidebar">
              <div class="logo">
                  <a href="/"><img src="https://i.imgur.com/2CXy1QL.png"></img></a>
                  </div>
         <p>Inbox</p>
         </div>
       </header>
       </div>
    );
  }

}

export default Header;
